import React from 'react';

const CarServices = (props) => {

  const servicesForCar = props.allCars.map((cars) => {
    return cars.map((car) => {
      if (car.id !== props.loadCarId) {
        return null;
      }
      return (
        <ul key={car.id}>
          <li>
            brand:<p>{car.brand}</p>
          </li>
          <li>
            series:<p>{car.series}</p>
          </li>
          <li>
            model:<p>{car.model}</p>
          </li>
          <li>
            year:<p>{car.year}</p>
          </li>
          <li>
            engine:<p>{car.engine}</p>
          </li>
          <li>
            mileage:<p>{car.mileage}</p>
          </li>
        </ul>
      );
    });
  });

  return (
    <div className="car-services">
      <div>
        <ul>
          <li>
            service: ['Engine oil', 'Engine oil filter', 'Engine Air filter'],
          </li>
          <li>date: '10-10-2021',</li>
          <li>mileage: 146880,</li>
          <li>info: 'Next change will be before 156880 or 10-10-2022',</li>
        </ul>
      </div>
      <div>
        <ul>
          <li>
            service: ['Engine oil', 'Engine oil filter', 'Engine Air filter'],
          </li>
          <li>date: '10-10-2021',</li>
          <li>mileage: 146880,</li>
          <li>info: 'Next change will be before 156880 or 10-10-2022',</li>
        </ul>
      </div>
    </div>
  );
};

export default CarServices;
